import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Navbar = () => {
  return (
    <nav className='navbar navbar-expand-lg navbar-dark bg-primary'>
      <span className='navbar-brand'>GitHub Avatar Flow</span>
    </nav>
  );
};

export default Navbar;
